import './App.css';

class App extends Component{
  render(){
    var a = 5 ;
      return (
        <div>
          <nav className="navbar navbar-inverse">
            <div className="container-fluid">
              <a className="navbar-brand">Title</a>
              <ul className="nav navbar-nav">
                <li className="active">
                  <a>Home</a>
                </li>
                <li>
                  <a>Link</a>
                </li>
              </ul>
            </div>
          </nav> 
          <div>
            <h2>
              {a}
            </h2>
          </div>
        </div> 
      );
  }

}

export default App;
